import ReactDOM from 'react-dom';

function Hello({library, name, number }) {
  // console.log(Object.values(props));
  return (<div>
    <h1>Welcome to {library}</h1>
    <p>What happens?</p>
    <p>I'm {name}</p>
    <p>There are {number} props</p>
  </div>
  )
}

ReactDOM.render(
    <Hello library="React" name="ali" number={3}/>,
  document.getElementById('root')
);
